/*===========================================================
   ROLLOVER BAR CHART (Console ASCII Style)
   Bar length now depends on OI (NOT rollover%)
===========================================================*/

function rolloverBarChart() {
  // ========= Detect active symbol (attempt)
  function getActiveSymbol() {
    try {
      const tabs = document.querySelectorAll(
        ".top_tab_parent .draggable_top_bar .top_bar .w-100"
      );
      for (const tab of tabs) {
        const a = tab.querySelector(".top_bar_item.active a");
        if (a && a.textContent.trim())
          return a.textContent.trim().toUpperCase();
      }
    } catch (e) {
      /* ignore */
    }
    return null;
  }

  // ---------- pick symbol & rollover object (if you use rollover map externally)
  let symbol = getActiveSymbol();

  // ========= format Indian
  function formatIndian(num) {
    if (!isFinite(num)) return "-";

    const x = num.toString().split(".");
    let int = x[0];
    const dec = x.length > 1 ? "." + x[1] : "";

    // Indian number formatting
    int = int.replace(/\B(?=(\d{2})+(?!\d))/g, ",");

    // Convert to Cr / Lac
    let suffix = "";
    if (num >= 1e7) suffix = ` (${(num / 1e7).toFixed(2)} Cr)`;
    else if (num >= 1e5) suffix = ` (${(num / 1e5).toFixed(2)} Lac)`;

    return int + suffix;
  }

    // =======================================
  const data = rolloverData[symbol];
  if (!data) {
    console.log(`âŒ Symbol '${symbol}' not found in rolloverData`);
    return;
  }

  const months = Object.keys(data)
    .filter(
      (k) =>
        k.endsWith("_25") &&
        !isNaN(Date.parse("2025-" + k.split("_")[0] + "-01"))
    )
    .sort((a, b) => {
      const d1 = new Date("2025-" + a.split("_")[0] + "-01");
      const d2 = new Date("2025-" + b.split("_")[0] + "-01");
      return d1 - d2;
    });

  const toNum = (v) => {
    if (v === "-" || v === undefined || v === null) return NaN;
    const n = Number(v);
    return isFinite(n) ? n : NaN;
  };

  const rows = [];

  let maxOI = 0; // find max OI_to

  for (let i = 0; i < months.length - 1; i++) {
    const m1 = months[i];
    const m2 = months[i + 1];

    const oiA = toNum(data[m1]);
    const oiB = toNum(data[m2]);

    if (isFinite(oiB)) maxOI = Math.max(maxOI, oiB); // find global max OI

    let pct;
    if (!isFinite(oiA) && !isFinite(oiB)) pct = NaN;
    else if (!isFinite(oiA)) pct = 100;
    else if (!isFinite(oiB)) pct = 0;
    else pct = (oiB / (oiA + oiB)) * 100;

    rows.push({
      label: `${m1} â†’ ${m2}`,
      value: isFinite(pct) ? Number(pct.toFixed(2)) : 0,
      oiA,
      oiB,
    });
  }

  // Reverse: latest â†’ oldest
  rows.reverse();

  const TITLE = `${symbol} `;

  console.log(
    `%c${TITLE}%c ::::::  Rollover Analyzer`,
    `color:#00bcd4; font-size:26px; font-weight:900;  padding:10px 0px;`,
    `color:#80d8ff; font-size:14px; font-weight:bold;`
  );

  rows.forEach((row) => {
    const barLength = Math.round(((row.oiB || 0) / maxOI) * 80); // 60 = max bar width
    const bar = "â–ˆ".repeat(barLength);

    console.log(
      `%c${row.label.padEnd(14)} | %c${bar}%c  ${row.value}%  %cOI::: %c${formatIndian(row.oiB)}`,
      "color:#9aa0a6; font-weight:bold;",
      "color:#287bf0;",
      "color:#fff;",
      "color:#f1f3f4;",
      "color:#D9A441; font-weight:bold; font-size: 14px;",
    );
  });
}

rolloverBarChart();
